import React from 'react';
import '../css/cardCss.css'

type props =  {
    users: string,
    age: number
}

const UsersList = ({props}: props[]) => {
    return (
        <ul>
            {props.map((user: props) => {
                <li>
                    <text>{user.users} ({user.age} years old)</text>
                </li>
            })}
        </ul>
    )
};

export default UsersList;
